content:
Không biết việc xé bao bì có nằm trong công việc kiểm tra chất lượng hàng hóa không nhưng mình phải nói là mình cực kì không hài lòng về dịch vụ lần này của Tiki, vì:
1/ Bao bì bị xé một cách mất thẩm mỹ;
2/ Góc giấy bị cong ở khá nhiều tờ và một số khác còn hằn cả vài đường gì đó.

